using ChessChallenge.API;
using System;
using System.Collections.Generic;
using System.Diagnostics;
using System.Linq;

public class MyBot : IChessBot
{
    private const int NUM_INPUTS = 501;
    private const int NUM_PARAMS = 16 * NUM_INPUTS + 16 + 512 + 32 + 512 + 16 + 16 + 1;

    private ConvolutionalNeuralNet neuralNet;

    public MyBot()
    {
        neuralNet = new(new[] { 
            (new float[4,13,1,1], new float[4]),
            (new float[4,4,3,3], new float[4]),
            (new float[4,4,3,3], new float[4]),
            (new float[1,4,3,3], new float[1])
        });

        float[] pretrainedParameters = new float[NUM_PARAMS];
        //byte[] parametersAsBytes = Convert.FromBase64String(ENCODED_PRETRAINED_PARAMS);
        //Buffer.BlockCopy(parametersAsBytes, 0, pretrainedParameters, 0, NUM_PARAMS * 4);
        neuralNet.LoadParameters(pretrainedParameters);
    }

    public Move Think(Board board, Timer timer)
    {
        Move[] moves = board.GetLegalMoves();
        float[] evals = moves.Select(m => EvalMove(board, m)).ToArray();
        return moves[Array.IndexOf(evals, board.IsWhiteToMove ? evals.Max() : evals.Min())];
    }

    private float EvalMove(Board board, Move move)
    {
        board.MakeMove(move);
        float[,,] inputs = new float[13, 8, 8];
        Buffer.BlockCopy(BoardToFenChars(board).Select(FenCharToClassIndex).SelectMany(ClassIndexToOneHot).ToArray(),
                         0, inputs, 0, 13 * 8 * 8 * sizeof(float));
        float eval = neuralNet.GetOutputs(inputs).Cast<float>().Sum();
        board.UndoMove(move);
        return eval;
    }

    internal static IEnumerable<char> BoardToFenChars(Board board)
        => board.GetFenString().Split(' ')[0].Split('/').SelectMany(rank => rank)
            .SelectMany(c => char.IsNumber(c) ? Enumerable.Repeat('_', int.Parse(c.ToString())) : Enumerable.Repeat(c, 1));

    internal static int FenCharToClassIndex(char c)
        => char.ToLower(c) switch
        {
            '_' => 0,
            'p' => 1,
            'n' => 2,
            'b' => 3,
            'r' => 4,
            'q' => 5,
            'k' => 6,
            _ => throw new ArgumentException($"Invalid FEN character: {c}")
        } + (char.IsUpper(c) ? 6 : 0);

    internal static IEnumerable<float> ClassIndexToOneHot(int i)
        => Enumerable.Repeat(0.0f, i).Append(1.0f).Concat(Enumerable.Repeat(0.0f, 12 - i));

    private class ConvolutionalNeuralNet
    {
        private readonly (float[,,,] Weights, float[] Biases)[] layers;

        public ConvolutionalNeuralNet((float[,,,] Weights, float[] Biases)[] layers)
        {
            this.layers = layers;
        }

        public void LoadParameters(IEnumerable<float> parameters)
        {
            float[] paramArray = parameters.ToArray();
            var p = 0;
            for (int l = 0; l < layers.Length; l++)
            {
                var layer = layers[l];
                int weightsSize = layer.Weights.Length;
                int biasesSize = layer.Biases.Length;
                Debug.Assert(p <= paramArray.Length - weightsSize - biasesSize);
                Buffer.BlockCopy(paramArray, sizeof(float) * p, layer.Weights, 0, sizeof(float) * weightsSize);
                p += weightsSize;
                Buffer.BlockCopy(paramArray, sizeof(float) * p, layer.Biases, 0, sizeof(float) * biasesSize);
                p += biasesSize;
            }
        }

        public float[,,] GetOutputs(float[,,] inputs)
        {
            for (int l = 0; l < layers.Length; l++)
            {
                var layer = layers[l];
                inputs = ApplyLayer(inputs, layer.Weights, layer.Biases, l < layers.Length - 1);
            }
            return inputs;
        }

        private float[,,] ApplyLayer(float[,,] inputs, float[,,,] weights, float[] biases, bool activate)
        {
            (int inChannels, int h, int w) = (inputs.GetLength(0), inputs.GetLength(1), inputs.GetLength(2));
            (int outChannels, int kh, int kw) = (biases.Length, weights.GetLength(2), weights.GetLength(3));
            Debug.Assert(inChannels == weights.GetLength(1));
            Debug.Assert(kh % 2 == 1 && kw % 2 == 1);

            float[,,] outputs = new float[outChannels, h, w];
            // For each output channel k...
            for (int k = 0; k < outChannels; k++)
            {
                // For each output value (r,c)...
                for (int r = 0; r < h; r++)
                {
                    for (int c = 0; c < w; c++)
                    {
                        float output = biases[k];
                        
                        // For each input channel j...
                        for (int j = 0; j < inChannels; j++)
                        {
                            // For each kernel weight (kr, kc) between channels k and j...
                            for (int kr = 0; kr < kh; kr++)
                            {
                                for (int kc = 0; kc < kw; kc++)
                                {
                                    int rWithPadding = r + kr - (kh / 2);
                                    int cWithPadding = r + kc - (kw / 2);
                                    if (rWithPadding >= 0 && rWithPadding < h &&
                                        cWithPadding >= 0 && cWithPadding < w)
                                    {
                                        output += inputs[j, rWithPadding, cWithPadding] * weights[k, j, kr, kc];
                                    }
                                }
                            }
                        }

                        outputs[k, r, c] = activate ? Math.Max(0.0f, output) : output;
                    }
                }
            }

            return outputs;
        }
    }

